import React, { useState } from "react";
import Card from "../UI/card";
import ExpenseDate from "./ExpenseDate";
function ExpenseForm(props) {
  return (
    <Card>
      <ExpenseDate />
      <div>{props.title}</div>
      <div>{props.amount}</div>
      <div>
        <button>Submit</button>
      </div>
    </Card>
  );
}

export default ExpenseForm;
